INSERT INTO `comments` (`comment_id`, `post_id`, `user_id`, `comment`, `comment_date`) VALUES
(50, 46, 41, 'Yes u are right bro!!it will also provide employment opportunity.', '2017-01-18 15:45:04'),
(51, 46, 41, 'These will reduce the wastage of paper(digital indiaâ˜ºðŸ˜ŠðŸ˜Š', '2017-01-18 16:10:42'),
(52, 47, 47, '', '2017-01-19 18:27:17'),
(53, 50, 47, 'Hey, almost  all  of  us  are  clueless  about  the  qquestion-"Which branch should  i take".\r\nI  too  want  to  choose  electrical  eengineering  but  due  to  rank deficit got mining engineering.But jee ccounseling  is not an end but infact  it is the beginning  of  plethora  of opportunity. Once you enter a  good  college ccampus i.e. nit''s a  large number of opportunities await you and it depends entirely  on  you how to channelise those opportunities.\r\nI have seen best coder from mining branch,\r\nLiterature freak, management  gurus, entrepreneurs  from mining branch.\r\nsometimes  ggetting a branch is purely  a  coincidence  or inevitable .\r\nYour  pasSion, aspirations and hardworks will collectively decide what you become.\r\nAll the  best.', '2017-02-09 15:11:08'),
(54, 50, 53, 'If you are in 1st year, you can slide from your branch after  completion of 1 year. For that you have to maintain a good CPI at the end of 1st year fill the sliding form of your college.\r\nAnd even if you are not able to slide through, you can always pursue on your dreams by studying all by yourself. In fact, if you have good or even basic knowledge of software engineering, you can sit for the placements in a lot of IT companies, whatever your branch maybe.', '2017-02-09 18:23:26'),
(55, 54, 38, 'They should be prepared before the commencement of the exams. But as we all know it''s a trend now to study a night before exam but I should prefer to have atleast an analysis of the exam so that they''ll be aware of the questions to be asked. Thanks', '2017-02-18 17:32:27'),
(56, 54, 47, 'Dear\r\nThere are two things-\r\n1.In the long run one gets used to everything or\r\n2.In the lOng run all are dead.\r\nfrankly  speaking  the goal of education  is sustainable in lOng run.don''t  just study  for the sake of exams. Prepare  your lOng terms  goals and  plans  and act accordingly.\r\nEXtra efforts  never go in vain.\r\nSo analyse  your ability  and methodology and put some eXtra efforts  during exams.\r\nNever forget to have a good meal during exams.relieve yourself listening to ghazals  songs which acts as stress buster.\r\nKeep calm and then study  for exams.', '2017-02-18 17:50:56'),
(57, 53, 114, 'Appreciable maiden-piece , yet lacks coherence.', '2017-02-18 21:03:26'),
(58, 53, 0, 'Nice... You should have use d the capital letters properly. ðŸ˜Š', '2017-02-18 21:34:10'),
(59, 46, 114, 'Hello there! This is going to be an absolutely irrelevant comment as far as your article is concerned, yet since I joined this website very recently and figured out that you are one of the founders the issues must be posted to you.\r\n\r\nDisregarding the lack of any private messaging option( one of the issue I am going to talk of ) I decided to post it here in the "comments" section.\r\n\r\n1. How do I edit/delete an article?\r\n2. Private messaging?\r\n3. Grammatical errors at places. \r\n4. How long will it take before the idea of App development is conceived? \r\n5. How to edit/delete "comments"?\r\n6. How to edit/delete pictures posted along with articles?\r\n\r\nThis much will do for now. I shall hopefully update you with more as I come across.\r\nThank you.\r\nPS, Once again, lots of congratulations and blessings.', '2017-02-18 22:18:43'),
(60, 57, 38, 'Thank you so much Yashaswinee for your blessing and this positive post. We''re very grateful to have such blessings from you, it will surely enhance our intensity to work for this emerging platform. And I do hope that if we get support from people like you we''ll surely reach the peak. Thanks to be a part of thetweaks !!..ðŸ˜ŠðŸ˜Š', '2017-02-19 05:09:26'),
(61, 57, 46, 'Thanks @yashaswinee raj for joining and blessings. We can only success by joining person like you. Also i will  expect you share some ideas which help others and make a better society for everyone.', '2017-02-19 08:18:38'),
(62, 58, 38, 'Thank you so much Sir for this post. It''ll surely help us and other students will surely learn from it. We''re pleased to have you as part of the TheTweaks.ðŸ˜Š', '2017-02-19 17:51:29'),
(63, 54, 0, 'I sometimes face the same problem. ''', '2017-02-19 17:59:25');
INSERT INTO `posts` (`post_id`, `user_id`, `post_title`, `post_date`, `post_author`, `post_image`, `post_content`, `tags`, `categories`) VALUES
(46, 38, 'Online Admission procedure', '2017-01-18', 'Deepanshu', '', 'There should be an online procedure to submit the application of registration for new admission. There are so many students who have to come to college from far distances just  for admission process .\r\nSo there should be some criteria by which applicant can upload documents online and it will also help university so that they can access all the documents in a online database and keep record in online database.', '#Education#NITRR', 'engineering'),
(47, 47, 'Stop War', '2017-01-19', 'Prof Gibrel', '', 'George Orwell once wrote that, Itâ€™s not a matter of whether the war is not real or if it is Victory is not possible. The war is not meant to be won it is meant to be continuous. Hierarchical society is only possible on the basis of poverty and ignorance. This new version is the past and no different past can ever have existed. In principle the war effort is always planned to keep society on the brink of starvation. The war is waged by the ruling group against its own subjects and its object is not the victory over either Eurasia or East Asia but to keep the very structure of society intact.\r\n#Orwell.', '#War #Orwell', 'society'),
(50, 59, 'Branch of my choice', '2017-02-09', 'shekhar@1', '', 'After the JEE Mains Counselling,  I did not get the branch of my choice.  I wanted to become a Software Engineer but my rank deficit didn''t gave me the luxury to get that branch in my favourite college.  Compromising over a good college was a tough decision for me since I wanted an awesome college life.  But now think,  I took a wrong decision. I am feeling helpless ðŸ˜£ ', '#counselling ', 'admission'),
(51, 60, 'Marks don''t Matter', '2017-02-09', 'Rohit@1', '', 'Engineering life is not just about getting good  grades, maintaining your CGPAs to 9-10. It doesn''t matter much in your future life.  Although you should try to maintain a decent CGPAs but you should strive more to become a better person. Once you come out of your 4 years of college life,  nobody is going to ask you your marks but people will judge you based on your personality,  your knowlege and behaviour.  Make yourself a better person not a better marks holder. ', '#DontStudyForMarks', 'study'),
(52, 53, 'No Standing in Cinema Theatres', '2017-02-16', 'SkupTalks', 'IMG_20170216_102408-1-1.jpg', 'Now you don''t have to unnecessarily stand up in Cinema theatres while playing of national anthem. ', '#nationalAnthem #supremeCourt', 'society'),
(53, 47, 'why many of us fear English language?', '2017-02-18', 'Prof Gibrel', '', 'i always find great difficulty in giving answer to this question. before giving answer to this question i would  like to raise some questions.\r\n1. does an englishman speak hindi fluently or for matter of fact any indian language?\r\n2.can you ask an african tribal folk to cheer for english language?\r\n3.how can you force a latin american inhabitant to follow english ?\r\nthese questions have been asked for some good reasons.the crux of the questions is-" what are the factors that affect a language or it"s growth in a particular region"?\r\n\r\nThe main factors are-\r\n1.cultural barriers and local traditions\r\n2.the way in which education is imparted to us\r\n3.promotion by state and government.\r\n\r\nbelieve i got my education from an english medium school i.e, DAV ARA in bihar.it is the premier school of the region but still we were never taught in english language.our teachers used to teaach us in hindi and many a one used bhojpuri language too.\r\ni was lucky enough that i was taught english by my father who used to give me the task of writing 3-4 articles per week.\r\nbut everyone is not lucky enough to enjoy the privilege like me.\r\nso, how can you ask a student to cheer for wordsworth,keats,shilley,tennyson,gb shaw, vikram seth  at a place where even the english is taught in an imported translated version.\r\nthis is the case with a student coming from an english medium school.\r\nGod forbid the students coming from the hindi medium background.some exceptions are always there but exceptions can"t change the rule.\r\nStudents coming from a convent based background are blessed enough tto rule out the mysticism behind this problem.\r\ni am got generalising anyone though generalisation is intellectually necessary evils.\r\nin the next tweak i will suggest how to root the roost or rule the world.\r\nhope everyone will find my views useful.\r\nthanks.\r\nkeep tweaking as it"s new sexy.', '', 'academics'),
(54, 91, 'Fear', '2017-02-18', 'anmishra013@gmail.com', '', 'Some time people are afraid during exam session. They are going to depressed. What should we do ?', '', 'study'),
(55, 114, 'My First Tweak', '2017-02-18', 'ychiteshvarayan@gmail.com', '', 'As Nishant invited me to log on to this new web site this evening, my first reaction was - confusion! \r\nYeah, that is right. \r\nSo once done with whatever stuff I have been occupied with all evening, finally I decided to figure out what he had been talking of.\r\n\r\nIt took me yet four-five minutes or so to land up here and reckon that it is a made-by-friends-in-India website that I have been invited to become a part of!\r\n\r\nThis is exciting.\r\nSo thank you very much to the team of founders and co-founders and everyone who has been involved in the idea since the beginning. Thank you to all the people who are joining , will join and my friend for inviting me.\r\n\r\nI wish #thetweaks becomes a real success in future.\r\nAll the very best!\r\n\r\nMay God bless us all with new, noble ideas and the ability to transform them to actions.\r\nAmen.', '#kudostofounders', ''),
(56, 114, 'My First Tweak', '2017-02-18', 'ychiteshvarayan@gmail.com', '', 'As Nishant invited me to log on to this new web site this evening, my first reaction was - confusion! \r\nYeah, that is right. \r\nSo once done with whatever stuff I have been occupied with all evening, finally I decided to figure out what he had been talking of.\r\n\r\nIt took me yet four-five minutes or so to land up here and reckon that it is a made-by-friends-in-India website that I have been invited to become a part of!\r\n\r\nThis is exciting.\r\nSo thank you very much to the team of founders and co-founders and everyone who has been involved in the idea since the beginning. Thank you to all the people who are joining , will join and my friend for inviting me.\r\n\r\nI wish #thetweaks becomes a real success in future.\r\nAll the very best!\r\n\r\nMay God bless us all with new, noble ideas and the ability to transform them to actions.\r\nAmen.', '#kudostofounders', 'society'),
(57, 114, 'My First Tweak', '2017-02-18', 'ychiteshvarayan@gmail.com', 'IMG-20170215-WA0002.jpeg', 'As Nishant invited me to log on to this new web site this evening, my first reaction was - confusion! \r\nYeah, that is right. \r\nSo once done with whatever stuff I have been occupied with all evening, finally I decided to figure out what he had been talking of.\r\n\r\nIt took me yet four-five minutes or so to land up here and reckon that it is a made-by-friends-in-India website that I have been invited to become a part of!\r\n\r\nThis is exciting.\r\nSo thank you very much to the team of founders and co-founders and everyone who has been involved in the idea since the beginning. Thank you to all the people who are joining , will join and my friend for inviting me.\r\n\r\nI wish #thetweaks becomes a real success in future.\r\nAll the very best!\r\n\r\nMay God bless us all with new, noble ideas and the ability to transform them to actions.\r\nAmen.', '#kudostofounders', 'society'),
(58, 78, 'Points to ponder', '2017-02-19', 'sameerranjan009@gmail.com', 'download.jpg', 'Placement from campus is something which every single student dreams of while taking admission into a college with magnanimous background like NITs. But in the end the cruel truth exists which hints us that only 60-70% of students are getting placed and as a matter of surprise this is above average placements of all NITs combined. If you think that you will end up in majority of students who will be getting placed, you may be wrong because of your loose attitude towards your problems. Thanks to the founder of thetweaks; I will be discussing various problems being faced by students across various colleges. Before starting any sub topic I would like to bring your attention to the fact that placement is more about having attitude, ethics, personality and aura rather than mere bookish knowledge. Please don''t confuse here, as bookish knowledge is as important as anything else but the importance and extent of knowledge varies with the targeted company of yours for placement. \r\n\r\nStarting with your attempt to camouflage with your competitors you should and must start working on prime aspect required for placement i.e. fluent spoken English. Now, you may argue with me as why English is required for placements? Answer is it is not important parameter to judge your technical knowledge or your zeal to work in that company rather it is important for an organization to seek candidates who can represent them at global network where medium of communication will be English and more important Fluent English will give you an edge over others as you can spin a good web of answers by carefully playing with words. Now to deal with this language, you have to be an early bird because you won''t be able to get it correct or fluent or even a confident English just to introduce yourself in 1 month. It is a process which evolves with time and eventually you starts speaking just like your mother tongue. Best way to start speaking English is start listening English, of course if you are nerd you can see videos of your subjects being taught by foreign universities or political debates from Oxford Debate Club, if you are news enthusiasts then follow BBC or if you don''t want these in your life, then watch few good TV series, for engineers I would recommend Big Bang Theory, FRIENDS and Game of Thrones (caution - these are fun TV shows, you may get addicted to them). Then start reading good novels side by side, you can start with few of Chetan Bhagat''s and then select genres from various authors(Charles Dicken, J K Rowling, George Orwell, Dan Brown, A C Doyle, Amitav Ghosh, Jhumpa Lahiri etc) . A piece of advice here would be don''t go direct for complex topics on suggestions, it will kill your interest in books, which I don''t want as a bibliophile. Next thing on the list will be start writing your thoughts, which will give you a confidence about your own understanding for a subject of concern. Don''t start blogging or jamming Facebook page, those can be tough for naive learners as you will be mocked a lot. You can start doing Mirror practice as it will give you enough confidence for your presentation skills. For mirror practice you need to watch yourself directly in your eyes as it will bring out all the fears hidden inside you. You should start engaging yourself in intellectual debates where you can test your hold on language and depth of knowledge over recent or medieval issues. To gather information refer to various newspapers and articles by scholars, don''t just follow any WhatsApp message and start uttering nonsense, it will prove your nature of being drifted easily by grapevine. \r\n\r\nSitting back in your room and waiting for miracle to happen will never suffice your goals, it is all up to you how much pain you take for making your dream come true. Everyone wants to enjoy success but only few lucky one gets this opportunity reason is very simple, they work very hard for making it happen.\r\n\r\nCatch you later with upcoming posts and best of luck thetweaks.com. I felt very honored as team contacted me for posting placement related queries and genuine thanks for thinking, I am eligible for doing this.', '#placement', 'placements'),
(59, 208, 'Habits', '2017-02-25', 'ravitejarallabandi@gmail.com', '', 'By seeing  habits we can say about a person. The main problem I faced with the habits is maintaining consistency in habits. For the first two days it went well, then the motivation gradually decreased.The main point that we must focus is this consistency in doing it daily..So Plan accordingly so that not doing that habits makes you uncomfortable. Because ultimately that little steps daily are needed for our ultimate goal.', '#Consistency #Habits', 'lifestyle');
